import { Injectable } from '@angular/core';
import { Place } from './place.model';

@Injectable({
  providedIn: 'root'
})
export class PlacesService {

  private _places: Place[]=[
    new Place(
      'p1',
      'Parc de garamba',
      'La RDC offre une gamme variée d’attraits touristiques à travers différentes provinces ',
      'https://www.investindrc.cd/fr/IMG/arton55.jpg',
      1500),
    new Place(
        'p2',
        'kingakati parc',
        ' un parc animalier de la république démocratique du Congo. Situé sur la commune de Maluku',
        ' data:image/jpeg;base64,',
          1500),
    new Place(
        'p3',
        'Parc national de Virunga',
        'Le parc national des Virunga est le plus ancien parc national de l Afrique',
        'data:image/jpeg;base64, ',
          1500)
  ];

  get places(){
    return [...this._places];
     }

  constructor() { }

  getPlace(id: string){
    return {...this._places.find(p=>p.id===id)};
  }
}
